import React from 'react';
import styled from 'styled-components';

const FullPageContainer = styled.div`
  min-height: 100vh;
  width: 100%;
  background-color: #1a1a1a;
  color: white;
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 20px;
  box-sizing: border-box;
`;

const Header = styled.header`
  text-align: center;
  margin-bottom: 40px;
`;

const Title = styled.h1`
  font-size: 2.5em;
  margin-bottom: 10px;
`;

const Subtitle = styled.p`
  font-size: 1.2em;
`;

const CirclesContainer = styled.div`
  display: flex;
  justify-content: center;
  flex-wrap: wrap;
  gap: 20px;
  margin-top: 20px;
`;

const Circle = styled.div`
  width: 200px;
  height: 200px;
  border-radius: 50%;
  background-color: ${props => props.color};
`;

const App = () => {
  return (
    <FullPageContainer>
      <Header>
        <Title>Have a look Around!</Title>
        <Subtitle>And you will find everything you need to build a great looking website</Subtitle>
      </Header>
      <CirclesContainer>
        <Circle color="#ff6b6b" />
        <Circle color="#51cf66" />
        <Circle color="#fcc419" />
      </CirclesContainer>
    </FullPageContainer>
  );
};

export default App;
